import React from 'react';
import Header from '../components/Header';

function Login() {
    return (
        <>
        <div className='form-signin position-static'>


            <h3 className='h3-light mb-3 fw-normal'>Please Sign-in</h3>
            <div className='form-floating'>
                <input className='form-control-sm' type='email' placeholder='name@example.com' />


            </div>
            <button className="w-20 btn btn-md btn-primary" type="submit">Sign in</button>
          </div>


        </>
    );
}

export default Login;
